import '../App.css';

const OnboardingPage = () => {
  return (
    <div className="onboarding-page" style={{ backgroundImage: `url(${backgroundImage})` }}>
      <header>
        <h1>Rentora</h1>
        {/* Add any other header content here */}
      </header>
      <section className="home-page">
        <h2>Welcome to Rentora</h2>
        {/* Add other content */}
      </section>
      <section className="about-page">
        {/* About page content */}
      </section>
      <Link to="#" className="get-started-btn">
        Get Started
      </Link>
    </div>
  );
};

export default OnboardingPage;
